        "https://images.unsplash.com/photo-1582830359896-d2e492f4a0fe?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=932&q=80",
      price: 90,
      name: "Blue Denim Jeans",
    },
  ],
};

const popularProductsReducer = (state = INITIAL_STATE, action) => {
  switch (action.type) {
    case ShopActionTypes.POPULAR_PRODUCTS_COLLECTIONS:
      return {
        ...state,
        collections: action.payload,
      };
    default:
      return state;
  }
};

export default popularProductsReducer;
